import React from 'react';
import '../style/header.css';
class Header extends React.Component {
  render() {
    return (
        <div className='header'>
          <div>
            <img className='img' src='https://bizweb.dktcdn.net/100/473/812/themes/889220/assets/logo.png?1685001259345'></img>
            <div>
                <input className='input' type='search'name='search' placeholder='Vui lòng nhập từ khóa' />
                <button className='button' type='submit'name='submit'>Tìm kiếm</button>
            </div>
            <div className='login'>
                <button className='button'>Đăng nhập</button>
            </div>
          </div>
          <div className='menu'>
              <ul>
                <li>TRANG CHỦ</li>
                <li></li>
              </ul>
          </div>
        </div>
    );
  }
}

export default Header;
